// src/components/AnalysisResults.js
import React, { useState } from "react";
import {
  LineChart,
  Leaf,
  Droplets,
  ThermometerSun,
  Sprout,
  Clock,
} from "lucide-react";

export function AnalysisResults({
  analysis,
  isAnalyzing,
  weather,
  location,
  aiSoilType,
  aiConfidence,
}) {
  // which crop is selected in the Growth Timeline tabs
  const [activeCropIndex, setActiveCropIndex] = useState(0);

  // ---------- NO DATA YET ----------
  if (!analysis) {
    return (
      <div className="bg-white rounded-3xl p-8 shadow-lg shadow-green-500/5 border border-green-100/70 flex flex-col items-center justify-center text-center min-h-[420px]">
        {isAnalyzing ? (
          <>
            <div className="w-14 h-14 rounded-full border-4 border-emerald-100 border-t-emerald-500 animate-spin mb-4" />
            <p className="text-green-900 text-lg font-medium">
              Analyzing your soil image…
            </p>
            <p className="text-green-700 text-sm mt-2 max-w-sm">
              Our AI is detecting soil type and generating crop recommendations
              based on your weather and location.
            </p>
          </>
        ) : (
          <>
            <LineChart className="w-10 h-10 text-emerald-500 mb-4" />
            <p className="text-green-900 text-lg font-medium">
              AI Analysis will appear here
            </p>
            <p className="text-green-700 text-sm mt-2 max-w-sm">
              Upload a soil image on the left to see soil type, nutrient levels,
              and best crops for your current conditions.
            </p>
          </>
        )}
      </div>
    );
  }

  const {
    soilType,
    pH,
    nutrients,
    moisture,
    texture,
    weatherAdjustment,
    locationAdjustment,
    recommendedCrops,
  } = analysis;

  const activeCrop =
    recommendedCrops && recommendedCrops.length > 0
      ? recommendedCrops[activeCropIndex]
      : null;

  // helper for match color
  const barColor = (value) => {
    if (value >= 90) return "bg-emerald-500";
    if (value >= 80) return "bg-green-500";
    return "bg-lime-500";
  };

  return (
    <div className="space-y-8">
      {/* --------- ANALYSIS SUMMARY CARD --------- */}
      <div className="bg-white rounded-3xl p-8 shadow-lg shadow-green-500/5 border border-green-100/70">
        <div className="flex items-center gap-3 mb-6">
          <div className="w-10 h-10 rounded-xl bg-gradient-to-br from-green-500 to-emerald-600 flex items-center justify-center">
            <LineChart className="w-5 h-5 text-white" />
          </div>
          <div>
            <h2 className="text-xl font-semibold text-green-900">
              Analysis Results
            </h2>
            <p className="text-green-700 text-sm">AI-powered insights</p>
          </div>
        </div>

        {/* weather + location notes */}
        <div className="grid md:grid-cols-2 gap-4 mb-6">
          {weatherAdjustment && (
            <div className="bg-amber-50 border border-amber-100 rounded-2xl px-4 py-3 text-sm text-amber-900 flex gap-3">
              <ThermometerSun className="w-5 h-5 mt-0.5 text-amber-500 shrink-0" />
              <p>{weatherAdjustment}</p>
            </div>
          )}
          {locationAdjustment && (
            <div className="bg-sky-50 border border-sky-100 rounded-2xl px-4 py-3 text-sm text-sky-900 flex gap-3">
              <Sprout className="w-5 h-5 mt-0.5 text-sky-500 shrink-0" />
              <p>{locationAdjustment}</p>
            </div>
          )}
        </div>

        {/* soil type + pH + moisture + NPK */}
        <div className="grid md:grid-cols-2 gap-6">
          {/* left column */}
          <div className="space-y-4">
            {/* soil type */}
            <div className="bg-emerald-50 rounded-2xl p-4 flex items-start gap-3">
              <Leaf className="w-5 h-5 text-emerald-600 mt-0.5" />
              <div>
                <p className="text-xs font-medium text-emerald-700 uppercase tracking-wide">
                  Soil Type
                </p>
                <p className="text-green-900 font-semibold mt-1">{soilType}</p>
                <p className="text-green-700 text-xs mt-1">{texture}</p>
                {aiSoilType && (
                  <p className="text-[11px] text-emerald-700 mt-2">
                    Model prediction:&nbsp;
                    <span className="font-semibold">{aiSoilType}</span>
                    {typeof aiConfidence === "number" && (
                      <> ({Math.round(aiConfidence * 100)}% confidence)</>
                    )}
                  </p>
                )}
              </div>
            </div>

            {/* pH + moisture */}
            <div className="grid grid-cols-2 gap-4">
              <div className="rounded-2xl border border-green-100 p-3">
                <p className="text-xs font-medium text-green-700 uppercase tracking-wide">
                  pH Level
                </p>
                <div className="mt-2 flex items-baseline gap-2">
                  <span className="inline-flex items-center justify-center px-2.5 py-1 rounded-full bg-green-600 text-white text-xs font-semibold">
                    {pH}
                  </span>
                  <span className="text-xs text-green-700">
                    {pH < 6.5
                      ? "Slightly acidic"
                      : pH > 7.5
                      ? "Alkaline"
                      : "Near neutral"}
                  </span>
                </div>
              </div>
              <div className="rounded-2xl border border-green-100 p-3">
                <p className="text-xs font-medium text-green-700 uppercase tracking-wide">
                  Moisture
                </p>
                <div className="mt-2 flex items-center gap-2">
                  <Droplets className="w-4 h-4 text-sky-500" />
                  <span className="text-sm text-green-900 font-medium">
                    {moisture}
                  </span>
                </div>
              </div>
            </div>

            {/* environment line */}
            {location && weather && (
              <p className="text-[11px] text-green-700 mt-1">
                Environment: {location.city}, {location.country} •{" "}
                {weather.temperature}°C • {weather.humidity}% humidity
              </p>
            )}
          </div>

          {/* right column – NPK table */}
          <div className="rounded-2xl border border-green-100 p-4">
            <p className="text-xs font-medium text-green-700 uppercase tracking-wide mb-3">
              Nutrient Levels (NPK)
            </p>
            <div className="grid grid-cols-3 gap-3 text-center">
              {["nitrogen", "phosphorus", "potassium"].map((key) => (
                <div
                  key={key}
                  className="bg-emerald-50 rounded-2xl py-3 px-2 flex flex-col items-center"
                >
                  <p className="text-[11px] uppercase tracking-wide text-emerald-700">
                    {key === "nitrogen"
                      ? "Nitrogen"
                      : key === "phosphorus"
                      ? "Phosphorus"
                      : "Potassium"}
                  </p>
                  <span className="mt-1 text-xs text-emerald-900 font-semibold">
                    {nutrients?.[key] || "Unknown"}
                  </span>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>

      {/* --------- RECOMMENDED CROPS SECTION --------- */}
      <div className="bg-white rounded-3xl p-8 shadow-lg shadow-green-500/5 border border-green-100/70">
        <div className="flex items-center justify-between gap-3 mb-6">
          <div>
            <h3 className="text-lg font-semibold text-green-900">
              Recommended Crops
            </h3>
            <p className="text-green-700 text-sm">
              Ranked by suitability for your soil and conditions.
            </p>
          </div>
        </div>

        <div className="space-y-4">
          {recommendedCrops.map((crop, index) => (
            <div
              key={crop.name}
              className="rounded-2xl border border-green-100 bg-emerald-50/40 hover:bg-emerald-50 transition p-4 flex flex-col gap-3"
            >
              <div className="flex items-start justify-between gap-3">
                <div className="flex items-start gap-3">
                  <div className="mt-1">
                    <Leaf className="w-5 h-5 text-emerald-600" />
                  </div>
                  <div>
                    <p className="text-sm font-semibold text-green-900">
                      {crop.name}
                    </p>
                    <p className="text-xs text-green-700 mt-1">
                      {crop.reason}
                    </p>
                    <p className="text-[11px] text-emerald-700 mt-1">
                      {crop.weatherImpact}
                    </p>
                  </div>
                </div>

                <div className="text-right">
                  <p className="text-[11px] uppercase tracking-wide text-green-700">
                    Match
                  </p>
                  <div className="inline-flex items-center justify-center px-2.5 py-1 rounded-full bg-emerald-600 text-white text-xs font-semibold">
                    {crop.suitability}% Match
                  </div>
                </div>
              </div>

              {/* match bar */}
              <div className="mt-1">
                <div className="h-2 rounded-full bg-emerald-100 overflow-hidden">
                  <div
                    className={`h-2 ${barColor(
                      crop.suitability
                    )} rounded-full transition-all`}
                    style={{ width: `${crop.suitability}%` }}
                  />
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* --------- GROWTH TIMELINE SECTION --------- */}
      {activeCrop && (
        <div className="bg-white rounded-3xl p-8 shadow-lg shadow-green-500/5 border border-green-100/70">
          <div className="flex items-center justify-between gap-3 mb-4">
            <div className="flex items-center gap-3">
              <div className="w-10 h-10 rounded-xl bg-green-50 flex items-center justify-center">
                <Clock className="w-5 h-5 text-emerald-600" />
              </div>
              <div>
                <h3 className="text-lg font-semibold text-green-900">
                  Growth Timeline
                </h3>
                <p className="text-green-700 text-sm">
                  Step-by-step guide for planting and harvesting in your soil
                  type.
                </p>
              </div>
            </div>
          </div>

          {/* tabs – crop names */}
          <div className="flex flex-wrap gap-2 mb-6">
            {recommendedCrops.map((crop, index) => {
              const active = index === activeCropIndex;
              return (
                <button
                  key={crop.name}
                  type="button"
                  onClick={() => setActiveCropIndex(index)}
                  className={`px-3 py-1.5 rounded-full text-xs font-semibold border transition ${
                    active
                      ? "bg-emerald-600 text-white border-emerald-600"
                      : "bg-emerald-50 text-emerald-700 border-emerald-200 hover:bg-emerald-100"
                  }`}
                >
                  {crop.name}
                </button>
              );
            })}
          </div>

          {/* vertical timeline for active crop */}
          <div className="relative pl-6">
            {/* line */}
            <div className="absolute left-[9px] top-1 bottom-2 w-px bg-emerald-200" />
            <div className="space-y-4">
              {activeCrop.growthTimeline.map((step, idx) => (
                <div key={idx} className="relative flex gap-4">
                  {/* dot */}
                  <div className="absolute -left-[10px] mt-1">
                    <div className="w-4 h-4 rounded-full bg-white border-2 border-emerald-500 flex items-center justify-center">
                      <div className="w-1.5 h-1.5 rounded-full bg-emerald-500" />
                    </div>
                  </div>

                  <div className="bg-emerald-50/70 rounded-2xl p-3 flex-1 border border-emerald-100">
                    <div className="flex items-center justify-between gap-3 mb-1">
                      <p className="text-sm font-semibold text-green-900">
                        {step.stage}
                      </p>
                      <span className="inline-flex items-center justify-center px-2.5 py-1 rounded-full bg-white text-[11px] text-emerald-700 border border-emerald-100">
                        {step.duration}
                      </span>
                    </div>
                    <p className="text-xs text-green-800">
                      {step.description}
                    </p>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      )}
    </div>
  );
}
